import React from 'react';
import './App.css';
import NavBar from'./Componenets/NavBar';
import Routes from './Routes';
import { BrowserRouter as Router,Switch, Route} from 'react-router-dom'; 



function App() {
  return (
    <div className="App">
      <NavBar />
      <Router>
        <Switch>
          {Routes.map((route) => (
          <Route exact path={route.path} key={route.path}>
            <route.component />
          </Route>
          ))}
        </Switch>
      </Router>

    </div>
  );
}

export default App;
